    const info = {
      lText: `${last7DaysSum}`,
      lTextBefore: this.$t('岩手県全域'),
      sText: this.$t('居住地が県外で県内滞在も含む'),
    }
    return {
      date,
      mapData,
      info,
      last7DaysSum,
    }
